    ('Teban Garden Road Blk 37A (Teban Gardens Market and Food Centre)','HUP Rebuilding','37A',1.3205173,103.7420807,'1/11/1976','Existing','25/5/2020',NULL,NULL,28,NULL,'West',NULL,NULL,52,NULL,33678.4,'26/5/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/resize_1262153022672.jpg','I','Completed',NULL,'2008-01-03 00:00:00',17936.37,'Teban Gardens Road',601037,'Located near Pandan Reservoir, the hawker centre comprises 28 cooked food stalls and 52 market stalls.  Built in 1976 to serve residents staying nearby.',NULL,'Blk 37A, Teban Garden Road, Singapore 601037','D50987C796CB7960',20200401082626),
    ('Telok Blangah Crescent Blk 11 (11 Telok Blangah Crescent Market and Food Centre)','HUP Standard Upgrading','11',1.27743995,103.8187332,'19/10/1974','Existing','29/6/2020',NULL,NULL,56,NULL,'West',NULL,NULL,77,NULL,28870.260000000002,'30/6/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/resize_1267876741836.gif','I','Completed',NULL,'2010-01-15 00:00:00',26366.58,'Telok Blangah Crescent',090011,'The hawker centre was built in 1974 to serve the dining and marketing needs of residents living in the Telok Blangah area.  After its facelift in 2009, the upgraded centre boasts enhanced features such as ramps and wider circulation spaces for the physically challenged and elderly patrons.',NULL,'Blk 11, Telok Blangah Crescent, Singapore 090011','917DDC2A98801394',20200401082626),
    ('Telok Blangah Drive Blk 79 (Telok Blangah Food Centre)','HUP Standard Upgrading','79',1.27342999,103.8076782,'30/5/1977','Existing','15/6/2020',NULL,NULL,40,NULL,'West',NULL,NULL,0,NULL,28428.13,'16/6/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/resize_1262153497855.jpg','I','Completed',NULL,'2005-08-20 00:00:00',25140.71,'Telok Blangah Drive',100079,'Situated directly opposite the Telok Blangah Community Centre, the hawker centre is a convenient location where residents of Telok Blangah can get to enjoy palatable local cuisines at affordable rates from the 40 cooked food stalls.',NULL,'Blk 79, Telok Blangah Drive, Singapore 100079','47E27FD7E376EE4C',20200401082626),
