    ('Telok Blangah Rise Blk 36 (Telok Blangah Rise Market)','HUP Standard Upgrading','36',1.27266002,103.8221283,'29/10/1975','Existing','13/4/2020',NULL,NULL,32,NULL,'West',NULL,NULL,103,NULL,28355.97,'13/4/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/resize_1267858653663.jpg','I','Completed',NULL,'2010-10-20 00:00:00',26753.38,'Telok Blangah Rise',090036,'Located near the scenic Mount Faber Park, the hawker centre has been serving the dining and marketing needs of residents in the vicinity since the 1970s.',NULL,'Blk 36, Telok Blangah Rise, Singapore 090036','336A650E63CB8BC9',20200401082626),
    ('Tiong Bahru Market','HUP Rebuilding','30',1.28468299,103.832428,NULL,'Existing','18/5/2020',NULL,NULL,83,NULL,'West',10630.72,NULL,259,NULL,29724.05,'18/5/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/resize_1262156378375.jpg','I','Completed',NULL,'2006-02-10 00:00:00',27892.07,'Seng Poh Road',168898,'Located in one of the oldest and most charming neighbourhoods, Tiong Bahru Market was built in 1950 as a single-storey centre.  The centre merged with Blk 84 and 84A Lim Liak Street during the upgrading in 2006, and was converted into a three-storey building: market stalls on the ground floor, cooked food stalls on the second floor and a carpark on the third. It is the fourth largest hawker centre in Singapore with 259 market stalls and 83 cooked food stalls! Well-known for the many popular stalls within the centre.',NULL,'30, Seng Poh Road, Singapore 168898','0FAB58D0E35385E5',20200401082626),
    ('Toa Payoh Lorong 1 Blk 127 (Toa Payoh West Market and Food Court)','HUP Reconfiguration','127',1.33816004,103.8447876,'11/3/1969','Existing','15/6/2020',NULL,NULL,40,NULL,'Central',NULL,NULL,108,NULL,35585.01,'18/6/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/resize_1262154499803.jpg','I','Completed',NULL,'2003-12-11 00:00:00',29270.15,'Lorong 1 Toa Payoh',310127,'Built in 1969, the two-storey hawker centre comprises 40 cooked food stalls and 108 market stalls. Well-known for hawker fare such as Chicken Rice, Hokkien Mee etc, the hawker centre serves both the dining and marketing needs of Toa Payoh residents.',NULL,'Blk 127, Lorong 1 Toa Payoh, Singapore 310127','ED2DB7B768A5283E',20200401082626),
