    ('Holland Village Market and Food Centre','HUP Rebuilding','1',1.31110203,103.7949448,'Pre-War','Existing','11/5/2020',NULL,NULL,21,NULL,'West',1512.38,NULL,48,NULL,32579.100000000002,'11/5/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/resize_1267415509849.jpg','I','Completed',NULL,'2005-12-12 00:00:00',23720.25,'Lorong Mambong',277700,'Situated right in the heart of Holland Village, the hawker centre was built in the pre-war years. One of the hawker centres with the longest history in Singapore! Surrounded by restaurants and bistros, the hawker centre remains a popular choice for patrons with its offering of affordable hawker fare. Comprises 21 cooked food stalls and 48 market stalls.',NULL,'1, Lorong Mambong, Singapore 277700','69A5ED128E190F44',20200401082626),
    ('Hougang Ave 1 Blk 105 (Hougang 105 Hainanese Village Centre)','HUP Rebuilding','105',1.35408998,103.890213,'30/6/1982','Existing','1/6/2020',NULL,NULL,51,NULL,'North',NULL,NULL,120,NULL,37326.05,'2/6/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/resize_1259901634108.jpg','I','Completed',NULL,'2005-11-11 00:00:00',34317.020000000004,'Hougang Ave 1',530105,'Also known as Hougang 105 Hainanese Village Centre, the hawker centre underwent a major facelift in 2005. A very popular hawker centre in the Hougang area, especially during the weekends. Serving the needs of both the residents of Lorong Ah Soo as well as the industrial area across at Defu Lane, there are currently 51 cooked food stalls and 120 market stalls within the centre.',NULL,'Blk 105, Hougang Ave 1, Singapore 530105','47665F1412FFBA90',20200401082626),
