    ('Jalan Kukoh Blk 1 (Kukoh 21 Food Centre)','HUP Standard Upgrading','1',1.28831995,103.8399963,'21/1/1969','Existing','15/6/2020',NULL,NULL,21,NULL,'Central',NULL,NULL,0,NULL,30071.510000000002,'15/6/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/resize_1267874440744.jpg','I','Completed',NULL,'2010-10-04 00:00:00',28737.57,'Jalan Kukoh',161001,'Built in 1969, Blk 1 Jalan Kukoh used to consist of both a market and food section. After upgrading in 2010, the centre was converted to a food centre with 21 cooked food stalls.',NULL,'Blk 1, Jalan Kukoh, Singapore 161001','8943084A8BD7A86A',20200401082626),
