    ('Jurong West Hawker Centre','New Centre','50',1.341223,103.697374,'28/7/2017','Existing (new)','11/5/2020',NULL,NULL,34,NULL,'West',2987,NULL,14,'2015-09-23 00:00:00',35935.62,'11/5/2020','http://www.nea.gov.sg/images/default-source/Hawker-Centres-Division/jurong-west-hawker-centre.jpg',NULL,NULL,'Jurong West Hawker Centre',NULL,12874.19,'Jurong West Street 61',648202,'Completed in 2017, Jurong West Hawker Centre provides residents a comfortable and clean dining environment with natural ventilation and family-friendly features such as child-friendly toilet facilities and family-friendly seating, as well as tray-return facilities at accessible locations. To ensure affordable meals for the residents, all the stalls are serving at least two items priced at $2.80 or below.','2015-10-15 00:00:00','Blk 50, Jurong West St 61, Singapore 648202','A85BCE9D0EEEBA52',20200401082626),
